import React from "react";

export default function (props) {
    const setObjectDisplay = (props)=>{
        switch (props.subMenuKey) {
            case 6 :
                return "Brief";
            case 7 :
                return "Marriott";
            case 8 :
                return "Ibm";
            case 9 :
                return "Pixelogic";

        }
    }
    return <div>
        {setObjectDisplay()}
    </div>
}
